{
    constructor(props:IProps)
    {
        super(props);
    }
    render()
    {
        return(
            <React.Fragment>
                <section>
  <div className="containor mt-2">
      <div className='row'>
          <div className='col-md-3'>
              <Card/>
          
  </div>
