              <Card/>
          
  </div>
  <div className='col-md-3'>
              <Card/>
          
  </div>
  <div className='col-md-3'>
              <Card/>
          
  </div>
  </div>
  </div>
  
          

      </section>
            </React.Fragment>
        );
    }
}

export default CardSection;
